import React from "react"

class Input extends React.Component {
  constructor(props) {
    super(props)
  }
  async handleChange(page, isLoaded) {
    this.props.changeParentValue({page: page, isLoaded: isLoaded})
  }

  render() {
    return (
      <div className="input-container">
        <input className="input-name" type="text" placeholder="Название" />
        <input className="input-price" type="number" placeholder="Цена" />
        <input className="input-brand" type="text" placeholder="Бренд" />
      </div>
    )
  }
}

export default Input
